;color:#000000;text-transform:none;text-indent:0px;letter-spacing:normal;word-spacing:0px;font-size-adjust:none;font-stretch:normal;background-color:#FFFFFF;-webkit-text-stroke-width:0px;\"><img style=\"margin:0px;padding:0px;border:0px currentcolor;\" src=\"http://goodsimg.1yyg.com/GoodsInfo/20140122085942359.jpg\" /></div><div style=\"font:12px/18px 微软雅黑;margin:0px auto;padding:0px;width:800px;color:#333333;text-transform:none;text-indent:0px;letter-spacing:normal;word-spacing:0px;font-size-adjust:none;font-stretch:normal;background-color:#FFFFFF;-webkit-text-stroke-width:0px;\"><p style=\"margin:0px;padding:20px 0px 10px;text-align:center;line-height:35px;font-size:24px;\">从现在开始<br style=\"margin:0px;padding:0px;\" />又一个难以实现，变成了难以或缺。</p><p style=\"margin:0px;padding:0px 20px 20px;text-align:center;line-height:25px;font-size:14px;\">64&nbsp;位架构的芯片、指纹识别传感器、更快速更优异的摄像头，以及专为&nbsp;64&nbsp;位架构而精心打造的操作系统。拥有其中任一功能都足以令一部智能手机超越时代。而将所有这些先进功能融入一款智能手机，则成就了注定要超越时代的&nbsp;iPhone。</p><p style=\"margin:0px;padding:0px 0px 20px;text-align:center;\"><img style=\"margin:0px;padding:0px;border:0px currentcolor;\" src=\"http://goodsimg.1yyg.com/GoodsInfo/20140122090008138.jpg\" /></p></div><div style=\"font:12px/18px 微软雅黑;margin:0px auto;padding:0px;width:800px;color:#333333;text-transform:none;text-indent:0px;letter-spacing:normal;word-spacing:0px;font-size-adjust:none;font-stretch:normal;background-color:#FFFFFF;-webkit-text-stroke-width:0px;\"><p style=\"margin:0px;padding:20px 0px 10px;text-align:center;color:#666666;line-height:35px;font-size:24px;\">黄金标准，<br style=\"margin:0px;padding:0px;\" />放之于银色和灰色皆准。</p><p style=\"margin:0px;padding:0px 20px 20px;text-align:center;line-height:25px;font-size:14px;\">iPhone&nbsp;5s&nbsp;精雕细琢的程度直至微米。通体上下，皆为明证：赏心悦目的铝金属外壳，金属与玻璃所呈现的光滑流丽，主屏幕按钮中的蓝宝石水晶，还有更多为&nbsp;iSight&nbsp;摄像头提供保护的蓝宝石水晶。如此高水准的设计与制造工艺，着实令人叹为观止。正是这一切成就了&nbsp;iPhone&nbsp;5s&nbsp;难以置信的纤薄外观和轻盈手感。现带来三款优雅色调：金色、银色和深空灰色。</p><p style=\"margin:0px;padding:0px 0px 20px;text-align:center;\"><img style=\"margin:0px;padding:0px;border:0px currentcolor;\" src=\"http://goodsimg.1yyg.com/GoodsInfo/20140122090036589.jpg\" /></p><p style=\"margin:0px;padding:0px 0px 20px;text-align:center;\"><img style=\"margin:0px;padding:0px;border:0px currentcolor;\" src=\"http://goodsimg.1yyg.com/GoodsInfo/20140122090047890.jpg\" /></p></div><div style=\"font:12px/18px 微软雅黑;margin:0px auto;padding:0px;width:800px;color:#333333;text-transform:none;text-indent:0px;letter-spacing:normal;word-spacing:0px;font-size-adjust:none;font-stretch:normal;background-color:#FFFFFF;-webkit-text-stroke-width:0px;\"><p style=\"margin:0px;padding:20px 0px 10px;text-align:center;line-height:35px;font-size:24px;\">Touch&nbsp;ID<br style=\"margin:0px;padding:0px;\" /><span style=\"margin:0px;padding:0px;color:#666666;\">你的指纹，你的iPhone。</span></p><div style=\"margin:0px auto;padding:0px;width:500px;text-align:center;font-size:12px;float:left;\"><img style=\"margin:0px;padding:0px;border:0px currentcolor;\" src=\"http://goodsimg.1yyg.com/GoodsInfo/20140122090106470.jpg\" /></div><div style=\"margin:0px auto;padding:0px;width:300px;font-size:12px;float:left;\"><p style=\"margin:0px;padding:80px 10px 40px 20px;line-height:25px;font-size:14px;\">你每天几十上百次地查看&nbsp;iPhone，甚至可能更频繁。而每次输入密码，都会拖慢你的使用速度。但之所以这样做，是为确保他人无法擅自使用你的&nbsp;iPhone，这点十分重要。iPhone&nbsp;5s&nbsp;让登入手机变得更快速，更轻松，甚至颇具未来感，因为我们推出了全新指纹识别传感器：Touch&nbsp;ID。</p><p style=\"margin:0px;padding:0px 10px 40px 20px;line-height:25px;font-size:14px;\">将你的手指放在主屏幕按钮上，仅此而已，iPhone&nbsp;就解锁了。通过这种方法，可以十分安全且非常方便地访问你的手机。在&nbsp;App&nbsp;Store&nbsp;和&nbsp;iBooks&nbsp;Store&nbsp;的购买或下载，也可通过你的指纹进行确认，因而不必输入密码。而且&nbsp;Touch&nbsp;ID&nbsp;能够&nbsp;360&nbsp;度读取指纹，这意味着无论你的&nbsp;iPhone&nbsp;处于纵向、横向或其他任何方向，都能读取你的指纹并识别你的身份。由于&nbsp;Touch&nbsp;ID&nbsp;可让你加入多个指纹，因此它也认识你所信赖的人。</p></div><div style=\"margin:0px auto;padding:0px;clear:both;font-size:12px;\">&nbsp;</div></div><div style=\"font:12px/18px 微软雅黑;margin:0px auto;padding:0px;width:800px;color:#333333;text-transform:none;text-indent:0px;letter-spacing:normal;word-spacing:0px;font-size-adjust:none;font-stretch:normal;background-color:#FFFFFF;-webkit-text-stroke-width:0px;\"><p style=\"margin:0px;padding:20px 0px;text-align:center;\"><img style=\"margin:0px;padding:0px;border:0px currentcolor;\" src=\"http://goodsimg.1yyg.com/GoodsInfo/20140122090115180.jpg\" /></p><p style=\"margin:0px;padding:20px 0px 10px;text-align:center;line-height:35px;font-size:24px;\">A7&nbsp;芯片<br style=\"margin:0px;padding:0px;\" /><span style=\"margin:0px;padding:0px;color:#666666;\">首开&nbsp;64&nbsp;位智能手机先河。</span></p><p style=\"margin:0px;padding:0px 20px 20px;text-align:center;line-height:25px;font-size:14px;\">不仅是快，更是&nbsp;A7&nbsp;芯片的快。全新&nbsp;A7&nbsp;芯片令你的中央处理器和图形处理性能较&nbsp;A6&nbsp;芯片快达&nbsp;2&nbsp;倍。更不同凡响的是，A7&nbsp;芯片使&nbsp;iPhone&nbsp;5s&nbsp;首开&nbsp;64&nbsp;位智能手机先河，将台式电脑级架构融入超纤薄的手机之中。由于&nbsp;iOS&nbsp;7&nbsp;是针对&nbsp;64&nbsp;位架构度身打造，因此其独特设计能够充分发挥&nbsp;A7&nbsp;芯片的强劲动力。</p><p style=\"margin:0px;padding:0px 0px 20px;text-align:center;\"><img style=\"margin:0px;padding:0px;border:0px currentcolor;\" src=\"http://goodsimg.1yyg.com/GoodsInfo/20140122090123241.jpg\" /></p></div><div style=\"font:12px/18px tahoma, arial, 宋体, helvetica, sans-serif;margin:0px auto;padding:0px;width:800px;color:#000000;text-transform:none;text-indent:0px;letter-spacing:normal;word-spacing:0px;font-size-adjust:none;font-stretch:normal;background-color:#FFFFFF;-webkit-text-stroke-width:0px;\"><div style=\"margin:0px auto;padding:0px;width:400px;color:#333333;font-family:微软雅黑;font-size:12px;float:left;\"><p style=\"margin:0px;padding:20px 20px 0px 10px;line-height:25px;font-size:14px;\">A7&nbsp;芯片支持&nbsp;OpenGL&nbsp;ES&nbsp;3.0&nbsp;版本，带来过去仅在&nbsp;Mac&nbsp;电脑、PC&nbsp;和游戏主机上才有的细致图形和复杂视觉效果。这种区别令人叹为观止。以游戏中的虚拟世界为例，质感纹理和阴影显得更加栩栩如生，阳光从水面折射出来的效果如此真实。整个体验都感觉更加生动逼真。</p></div><div style=\"margin:0px auto;padding:0px;width:400px;color:#333333;font-family:微软雅黑;font-size:12px;float:left;\"><p style=\"margin:0px;padding:20px 10px 0px 20px;line-height:25px;font-size:14px;\">iOS&nbsp;7&nbsp;和所有内置&nbsp;app&nbsp;都针对&nbsp;A7&nbsp;芯片进行了优化。相机&nbsp;app&nbsp;就是极好的例子。它充分利用&nbsp;A7&nbsp;芯片内置的全新图像信号处理器，使自动对焦快达&nbsp;2&nbsp;倍，照片捕捉速度更快，视频帧速率更高1。你可能以为有了这么多配置，电池使用时间会受到影响。但你多虑了，因为&nbsp;A7&nbsp;芯片的设计非常高效节能。</p></div><div style=\"margin:0px auto;padding:0px;clear:both;font-size:12px;\">&nbsp;</div><p style=\"margin:0px;padding:0px 0px 20px;text-align:center;border-bottom-color:#ACACAC;border-bottom-width:1px;border-bottom-style:solid;\"><img style=\"margin:0px;padding:0px;border:0px currentcolor;\" src=\"http://goodsimg.1yyg.com/GoodsInfo/20140122090131767.jpg\" /></p></div><div style=\"font:12px/18px 微软雅黑;margin:0px auto;padding:0px;width:800px;color:#333333;text-transform:none;text-indent:0px;letter-spacing:normal;word-spacing:0px;font-size-adjust:none;font-stretch:normal;background-color:#FFFFFF;-webkit-text-stroke-width:0px;\"><p style=\"margin:0px;padding:40px 0px 20px;text-align:center;line-height:35px;font-size:24px;\">M7&nbsp;协处理器<br style=\"margin:0px;padding:0px;\" /><span style=\"margin:0px;padding:0px;color:#666666;\">全新处理器，能效表现创新高。</span></p><p style=\"margin:0px;padding:0px 0px 20px;text-align:center;\"><img style=\"margin:0px;padding:0px;border:0px currentcolor;\" src=\"http://goodsimg.1yyg.com/GoodsInfo/20140122090137100.jpg\" /></p><div style=\"margin:0px auto;padding:0px;width:400px;color:#333333;font-family:微软雅黑;font-size:12px;float:left;\"><p style=\"margin:0px;padding:20px 20px 0px 10px;line-height:25px;font-size:14px;\">全新&nbsp;M7&nbsp;协处理器如同&nbsp;A7&nbsp;芯片的得力助手。它专为测量来自加速感应器、陀螺仪和指南针的运动数据而设计，如果没有它，这项任务通常会落在&nbsp;A7&nbsp;芯片身上。但&nbsp;M7&nbsp;协处理器更擅长于此。追踪身体活动的健身&nbsp;app&nbsp;现可从&nbsp;M7&nbsp;协处理器读取相关数据，因此无需持续访问&nbsp;A7&nbsp;芯片，从而降低了耗电量。</p></div><div style=\"margin:0px auto;padding:0px;width:400px;color:#333333;font-family:微软雅黑;font-size:12px;float:left;\"><p style=\"margin:0px;padding:20px 10px 0px 20px;line-height:25px;font-size:14px;\">无论你在走路，跑步，甚至开车，M7&nbsp;协处理器通通知晓。如果你的手机许久未动，例如当你睡觉时，M7&nbsp;协处理器会减少网络检测，从而节省电池电量。</p></div><div style=\"margin:0px auto;padding:0px;clear:both;font-size:12px;\">&nbsp;</div></div><div style=\"font:12px/18px 微软雅黑;margin:0px auto;padding:0px;width:800px;color:#333333;text-transform:none;text-indent:0px;letter-spacing:normal;word-spacing:0px;font-size-adjust:none;font-stretch:normal;background-color:#FFFFFF;-webkit-text-stroke-width:0px;\"><p style=\"margin:0px;padding:40px 0px 20px;text-align:center;\"><img style=\"margin:0px;padding:0px;border:0px currentcolor;\" src=\"http://goodsimg.1yyg.com/GoodsInfo/20140122090146255.jpg\" /></p><p style=\"margin:0px;padding:20px 0px 10px;text-align:center;line-height:35px;font-size:24px;\">iSight&nbsp;摄像头<br style=\"margin:0px;padding:0px;\" /><span style=\"margin:0px;padding:0px;color:#666666;\">全世界人见人爱的相机，全面超越自己。</span></p><p style=\"margin:0px;padding:0px 20px 20px;text-align:center;line-height:25px;font-size:14px;\">iPhone&nbsp;5s&nbsp;配备多项先进技术，专门为&nbsp;iSight&nbsp;摄像头的硬件和软件度身定制。因此，无论是谁，无论在哪里，都能随时拍摄出令人赞叹的精美照片。因为，教会&nbsp;iPhone&nbsp;如何拍摄精彩照片，要比教会使用者如何成为专业摄影师来得更合情合理。以下仅是全新&nbsp;iSight&nbsp;摄像头众多强大功能中的一部分。</p></div><div style=\"font:12px/18px tahoma, arial, 宋体, helvetica, sans-serif;margin:0px auto;padding:20px 0px;width:800px;color:#000000;text-transform:none;text-indent:0px;letter-spacing:normal;word-spacing:0px;font-size-adjust:none;font-stretch:normal;background-color:#FFFFFF;-webkit-text-stroke-width:0px;\"><div style=\"margin:0px auto;padding:0px;width:250px;color:#333333;font-family:微软雅黑;font-size:12px;float:left;\"><p style=\"margin:0px;padding:0px 0px 20px;text-align:center;\"><img style=\"margin:0px;padding:0px;border:0px currentcolor;\" src=\"http://goodsimg.1yyg.com/GoodsInfo/20140122090154599.jpg\" /></p><p style=\"margin:0px;padding:0px 0px 10px;text-align:center;line-height:25px;font-size:14px;font-weight:bold;\">感光元件、像素、光圈，全放大</p><p style=\"margin:0px;padding:0px 10px;line-height:22px;font-size:12px;\">光线是拍摄出色照片的一项关键因素。因此，全新&nbsp;iSight&nbsp;摄像头的感光元件增大了&nbsp;15%，单个像素尺寸得以提升，达到&nbsp;1.5&