gin:0px;padding:0px 0px 10px;text-align:center;line-height:25px;font-size:14px;font-weight:bold;\">自动图像防抖动功能</p><p style=\"margin:0px;padding:0px 10px;line-height:22px;font-size:12px;\">自动图像防抖动功能会在你需要时发挥作用，有助于降低噪点并减少因手部抖动或目标运动而造成的偏移。</p></div><div style=\"margin:0px auto;padding:0px 25px;width:250px;color:#333333;font-family:微软雅黑;font-size:12px;float:left;\"><p style=\"margin:0px;padding:0px 0px 20px;text-align:center;\"><img style=\"margin:0px;padding:0px;border:0px currentcolor;\" src=\"http://goodsimg.1yyg.com/GoodsInfo/20140122090236347.jpg\" /></p><p style=\"margin:0px;padding:0px 0px 10px;text-align:center;line-height:25px;font-size:14px;font-weight:bold;\">慢动作视频</p><p style=\"margin:0px;padding:0px 10px;line-height:22px;font-size:12px;\">你可以每秒&nbsp;120&nbsp;帧的速率拍摄&nbsp;720p&nbsp;视频，然后以&nbsp;1/4&nbsp;的速度播放任意片段，享受其美妙的戏剧化效果。然后与好友分享，赢得一片关注。</p></div><div style=\"margin:0px auto;padding:0px;width:250px;color:#333333;font-family:微软雅黑;font-size:12px;float:left;\"><p style=\"margin:0px;padding:0px 0px 20px;text-align:center;\"><img style=\"margin:0px;padding:0px;border:0px currentcolor;\" src=\"http://goodsimg.1yyg.com/GoodsInfo/20140122090241123.jpg\" /></p><p style=\"margin:0px;padding:0px 0px 10px;text-align:center;line-height:25px;font-size:14px;font-weight:bold;\">实时拍摄变焦</p><p style=\"margin:0px;padding:0px 10px;line-height:22px;font-size:12px;\">只需双指开合，实时拍摄变焦功能就能让你拉近镜头画面。当你拍摄时，可将任意拍摄对象放大高达&nbsp;3&nbsp;倍之多。</p></div><div style=\"margin:0px auto;padding:0px;clear:both;font-size:12px;\">&nbsp;</div></div><div style=\"font:12px/18px tahoma, arial, 宋体, helvetica, sans-serif;margin:0px auto;padding:20px 0px;width:800px;color:#000000;text-transform:none;text-indent:0px;letter-spacing:normal;word-spacing:0px;border-bottom-color:#ACACAC;border-bottom-width:1px;border-bottom-style:solid;font-size-adjust:none;font-stretch:normal;background-color:#FFFFFF;-webkit-text-stroke-width:0px;\"><div style=\"margin:0px auto;padding:0px;width:250px;color:#333333;font-family:微软雅黑;fon