:0px;\"><p style=\"margin:0px;padding:160px 0px 0px 350px;color:#333333;line-height:55px;letter-spacing:1px;font-size:35px;\">显示屏，不仅更薄，<br style=\"margin:0px;padding:0px;\" />还更显出色。</p><p style=\"margin:0px;padding:20px 20px 0px 350px;color:#333333;line-height:26px;letter-spacing:1px;font-size:15px;\">为打造&nbsp;iPad&nbsp;Air&nbsp;2&nbsp;令人惊叹的纤薄外形，我们从重新设计&nbsp;Retina&nbsp;显示屏开始，将原本的三层合为一层。这样做的成果不仅是让它更薄，同时也让显示效果更好。由此色彩表现更鲜艳，对比度也更出色。而且我们还增添了抗反射涂层，让&nbsp;iPad&nbsp;Air&nbsp;2&nbsp;的反光率再创新低。</p><p style=\"margin:0px;padding:20px 0px 0px 350px;color:#333333;line-height:48px;letter-spacing:2px;font-size:13px;\"><span style=\"margin:0px;padding:0px;font-size:38px;\">9.7</span><span class=\"Apple-converted-space\">&nbsp;</span>英寸<span class=\"Apple-converted-space\">&nbsp;</span><span style=\"margin:0px;padding:0px 0px 0px 20px;font-size:35px;\">2048×1536</span></p><p style=\"margin:0px;padding:0px 0px 0px 350px;color:#333333;line-height:20px;letter-spacing:2px;font-size:15px;\">显示屏<span class=\"Apple-converted-space\">&nbsp;</span><span style=\"margin:0px;padding:0px 0px 0px 70px;\">分辨率</span></p><p style=\"margin:0px;padding:20px 0px 0px 350px;color:#333333;line-height:48px;letter-spacing:2px;font-size:13px;\"><span style=\"margin:0px;padding:0px;font-size:38px;\">310<span class=\"Apple-converted-space\">&nbsp;</span></span>万<span class=\"Apple-converted-space\">&nbsp;</span><span style=\"margin:0px;padding:0px 0px 0px 20px;font-size:35px;\">264</span></p><p style=\"margin:0px;padding:0px 0px 0px 355px;color:#333333;line-height:20px;letter-spacing:2px;font-size:15px;\">像素<span class=\"Apple-converted-space\">&nbsp;</span><span style=\"margin:0px;padding:0px 0px 0px 90px;\">PPI</span></p></div><div style=\"background-position:50% 50%;font:12px/18px 微软雅黑;margin:0px auto;padding:0px 0px 10px;width:800px;height:620px;color:#333333;text-transform:none;text-indent:0px;letter-spacing:normal;word-spacing:0px;border-bottom-color:#999999;border-bottom-width:1px;border-bottom-style:solid;font-size-adjust:none;font-stretch:normal;background-image:url(&quot;http://goodsimg.1yyg.com/goodsinfo/20141024154856728.jpg&quot;);background-repeat:no-repeat no-repeat;-webkit-text-stroke-width:0px;\"><p style=\"margin:0px;padding:50px 0px 0px;text-align:center;color:#333333;line-height:50px;letter-spacing:4px;font-size:35px;\">力量极强大，形态极简约。</p><p style=\"margin:0px;padding:410px 60px 0px;text-align:center;line-height:26px;font-size:14px;\">iPad&nbsp;Air&nbsp;2&nbsp;不仅薄了许多，还强大更多。和上一代相比，我们设计的全新&nbsp;A8X&nbsp;芯片在中央处理器和图形处理器性能上均有切实显著的提升。事实上，凭借&nbsp;64&nbsp;位台式电脑级架构，iPad&nbsp;Air&nbsp;2&nbsp;所拥有的强大性能可与众多个人电脑相媲美。不仅如此，它的能效也非常出色，长达&nbsp;10&nbsp;小时的电池使用时间，可满足你日常一天的工作、娱乐、浏览网络及购物所用。</p></div><div style=\"font:12px/18px 微软雅黑;margin:0px auto;padding:0px 0px 10px;width:800px;color:#333333;text-transform:none;text-indent:0px;letter-spacing:normal;word-spacing:0px;border-bottom-color:#999999;border-bottom-width:1px;border-bottom-style:solid;font-size-adjust:none;font-stretch:normal;background-color:#FFFFFF;-webkit-text-stroke-width:0px;\"><p style=\"margin:0px;padding:50px 0px 0px;text-align:center;color:#333333;line-height:55px;letter-spacing:4px;font-size:35px;\">独一无二的指纹，<br style=\"margin:0px;padding:0px;\" />成就独到的安全保护。</p><p style=\"margin:0px;padding:20px 60px 0px;text-align:center;line-height:26px;font-size:14px;\">iPad&nbsp;Air&nbsp;2&nbsp;配备了我们突破性的&nbsp;Touch&nbsp;ID&nbsp;技术，它凭借你的指纹，这一与生俱来的完美密码，将安全性提升到前所未有的级别。因此，只需轻轻一触，你即可解锁自己的&nbsp;iPad&nbsp;Air&nbsp;2。但&nbsp;Touch&nbsp;ID&nbsp;所能做的远不止于此，它还可以让你在&nbsp;iBooks&nbsp;及&nbsp;App&nbsp;Store&nbsp;中安全地进行下载或购买。</p><p style=\"margin:0px;padding:50px 0px 0px;text-align:center;\"><img style=\"margin:0px;padding:0px;border:0px currentcolor;\" src=\"http://goodsimg.1yyg.com/GoodsInfo/20141024154914756.jpg\" /></p></div><div style=\"font:12px/18px 微软雅黑;margin:0px auto;padding:0px;width:800px;color:#333333;text-transform:none;text-indent:0px;letter-spacing:normal;word-spacing:0px;border-bottom-color:#999999;border-bottom-width:1px;border-bottom-style:solid;font-size-adjust:none;font-stretch:normal;background-color:#FFFFFF;-webkit-text-stroke-width:0px;\"><p style=\"margin:0px;padding:50px 0px 0px;text-align:center;color:#333333;line-height:55px;letter-spacing:4px;font-size:35px;\">两部出色的相机，<br style=\"margin:0px;padding:0px;\" />藏身一部&nbsp;iPad&nbsp;之中。</p><p style=\"margin:0px;padding:20px 30px 0px;text-align:center;line-height:26px;font-size:14px;\">iPad&nbsp;Air&nbsp;2&nbsp;配备了我们迄今为止极为出色的全新&nbsp;iSight&nbsp;摄像头。它拥有先进的光学技术、优化的传感器和&nbsp;Apple&nbsp;设计的强大图像信号处理器。它还加入一系列照片和视频的全新功能，如全景、延时摄影视频、慢动作视频，以及连拍快照和计时模式。前置&nbsp;FaceTime&nbsp;HD&nbsp;高清摄像头也经过重新设计，拥有优化的传感器和更大尺寸像素，使其在弱光条件下的表现更出色。这一切，让你所有照片和视频，以及视频通话和自拍，看起来都漂亮极了。</p><p style=\"margin:0px;padding:50px 0px 0px;text-align:center;\"><img style=\"margin:0px;padding:0px;border:0px currentcolor;\" src=\"http://goodsimg.1yyg.com/GoodsInfo/20141024154920765.jpg\" /></p></div><div style=\"font:12px/18px 微软雅黑;margin:0px auto;padding:0px;width:800px;color:#333333;text-transform:none;text-indent:0px;letter-spacing:normal;word-spacing:0px;border-bottom-color:#999999;border-bottom-width:1px;border-bottom-style:solid;font-size-adjust:none;font-stretch:normal;background-color:#FFFFFF;-webkit-text-stroke-width:0px;\"><p style=\"margin:0px;padding:50px 0px 0px;text-align:center;color:#333333;line-height:55px;letter-spacing:4px;font-size:35px;\">更快无线网络连接，<br style=\"margin:0px;padding:0px;\" />精彩无需等待。</p><p style=\"margin:0px;padding:20px 50px 0px;text-align:center;line-height:26px;font-size:14px;\">Pad&nbsp;Air&nbsp;2&nbsp;的无线网络连接速度非常快，达到前代产品的两倍以上。因此，下载大文件和传输流媒体视频都比以往更省时间。而且&nbsp;WLAN&nbsp;+&nbsp;Cellular&nbsp;机型还具备更快速、更先进的&nbsp;4G&nbsp;LTE&nbsp;技术，因此即使身处匆匆行程之中，你也能轻松连接高速网络。</p><p style=\"margin:0px;padding:20px 0px 0px;text-align:center;\"><img style=\"margin:0px;padding:0px;border:0px currentcolor;\" src=\"http://goodsimg.1yyg.com/GoodsInfo/20141024154927978.jpg\" /></p></div><div style=\"font:12px/18px 微软雅黑;margin:0px auto;padding:0px;width:800px;color:#333333;text-transform:none;text-indent:0px;letter-spacing:normal;word-spacing:0px;border-bottom-color:#999999;border-bottom-width:1px;border-bottom-style:solid;font-size-adjust:none;font-stretch:normal;background-color:#FFFFFF;-webkit-text-stroke-width:0px;\"><p style=\"margin:0px;padding:50px 0px 0px;text-align:center;color:#333333;line-height:55px;letter-spacing:4px;font-size:35px;\">众多&nbsp;App，为&nbsp;iPad&nbsp;量身打造，<br style=\"margin:0px;padding:0px;\" />也为成就你想做的一切。</p><p style=\"margin:0px;padding:20px 50px 0px;text-align:center;line-height:26px;font-size:14px;\">iPad&nbsp;Air&nbsp;2&nbsp;内置多款强大&nbsp;app&nbsp;来让你处理日常事务，比如浏览网络，查收电子邮件，编辑影片和照片，撰写报告和阅读图书。不仅如此，App&nbsp;Store&nbsp;中还有成千上万款&nbsp;app，专为&nbsp;iPad&nbsp;宽大的多点触控&nbsp;Retina&nbsp;显示屏而精心设计，绝不仅仅是手机&nbsp;app&nbsp;的简单放大。因此，无论你是爱好摄影，游戏，旅行，还是想管理自己的财务，总有一款&nbsp;app&nbsp;会让你做得更出色。</p><p style=\"margin:0px;padding:50px 0px 0px;text-align:center;\"><img style=\"margin:0px;padding:0px;border:0px currentcolor;\" src=\"http://goodsimg.1yyg.com/GoodsInfo/20141024154934369.jpg\" /></p></div><div style=\"font:12px/18px 微软雅黑;margin:0px auto;padding:0px;width:800px;color:#333333;text-transform:none;text-indent:0px;letter-spacing:normal;word-spacing:0px;border-bottom-color:#999999;border-bottom-width:1px;border-bottom-style:solid;font-size-adjust:none;font-stretch:normal;background-color:#FFFFFF;-webkit-text-stroke-width:0px;\"><p style=\"margin:0px;padding:50px 0px 0px;text-align:center;color:#333333;line-height:55px;letter-spacing:4px;font-size:35px;\">iOS&nbsp;8&nbsp;和&nbsp;iPad&nbsp;Air&nbsp;2，<br style=\"margin:0px;padding:0px;\" />强强联手。</p><p style=\"margin:0px;padding:20px 30px 0px;text-align:center;line-height:26px;font-size:14px;\">iOS&nbsp;8&nbsp;是超前的移动操作系统，其先进功能让&nbsp;iPad&nbsp;Air&nbsp;2&nbsp;变得更不可或缺。连续互通功能可让你在这部设备上开始一个项目，然后在另一部设备上继续完成。家人共享功能让你与多达六人轻松共享图书和&nbsp;app。而&nbsp;iCloud&nbsp;Drive&nbsp;可让你安全存储各种类型的文档，并从你的各种设备上访问。事实上，iOS&nbsp;8&nbsp;上的一切功能不仅是为了与&nbsp;iPad&nbsp;Air&nbsp;2&nbsp;默契配合而设计，也是为了将强大的&nbsp;A8X&nbsp;芯片、超快的无线连接、以及绚丽&nbsp;Retina&nbsp;显示屏的优势发挥到淋漓尽致而打造。</p><p style=\"margin:0px;padding:50px 0px 0px;text-align:center;\"><img style=\"margin:0px;padding:0px;border:0px currentcolor;\" src=\"http://goodsimg.1yyg.com/GoodsInfo/20141024154942167.jpg\" /></p></div><p>&nbsp;</p>',1009,1029,'/productImg/show/1015/1415155640974.png',1,'goods_tj','hot');

